import React from "react";
import ContactField from "./ContactField";
import './ContactForm.css'

const ContactForm = () => {

    return(
        <div className="contactForm">
            <h1> Patient Contact Details</h1>
            <ContactField fieldName='name' placeholder='Name' inputType='text'/>
            <ContactField fieldName='surname' placeholder='Surname' inputType='text'/>
            <ContactField fieldName='phone' placeholder='Phone' inputType='phone'/>
            <ContactField fieldName='dateOfBirth' inputType='date'/>
            <ContactField fieldName='text' placeholder='Describe your issue.' inputType='text'/>

        </div>
    )
}

export default ContactForm;
